describe('Blog Application', () => {
  beforeEach(() => {
    cy.visit('/');
  });

  it('should display the blog posts', () => {
    cy.contains('Blog Posts').should('be.visible');
    cy.get('li').should('have.length.greaterThan', 0);
  });

  it('should navigate to the first post page', () => {
    cy.get('li').first().click();
    cy.url().should('include', '/posts/1');
    cy.contains('First Post').should('be.visible');
  });

  it('should navigate to the second post page', () => {
    cy.get('li').eq(1).click();
    cy.url().should('include', '/posts/2');
    cy.contains('Second Post').should('be.visible');
  });
});

describe('Post Page', () => {
  it('should display the content of the first post', () => {
    cy.visit('/posts/1');
    cy.contains('First Post').should('be.visible');
    cy.contains('This is the full content of the first post.').should('be.visible');
  });

  it('should display the content of the second post', () => {
    cy.visit('/posts/2');
    cy.contains('Second Post').should('be.visible');
    cy.contains('This is the full content of the second post.').should('be.visible');
  });

  it('should show loading if post not found', () => {
    cy.visit('/posts/999');
    cy.contains('Loading...').should('be.visible');
  });
});
